import React from 'react'
import {StreamList} from '../StreamList'
import {PeopleList} from '../PeopleList'
import {OfferingsList} from '../OfferingsList'
import {useUrlParams} from '../../../Hooks/app'
import {useHomeList} from '../../../Hooks/home'
import {OrganizationList} from '../OrganizationList'
import {URL_KEYS, URL_VALUES} from '../../../Constants'

export const HomeContentView = () => {
    const {urlData} = useUrlParams()
    const {loadMore} = useHomeList()

    return (
        <>
            {
                urlData[URL_KEYS.SEARCH_TYPE] === URL_VALUES.OFFERINGS
                && <OfferingsList loadMore={loadMore}/>
            }
            {
                !urlData[URL_KEYS.SEARCH_TYPE]
                && <OrganizationList loadMore={loadMore}/>
            }
            {
                urlData[URL_KEYS.SEARCH_TYPE] === URL_VALUES.PEOPLE
                && <PeopleList loadMore={loadMore}/>
            }
            {
                urlData[URL_KEYS.SEARCH_TYPE] === URL_VALUES.STREAM
                && <StreamList loadMore={loadMore}/>
            }
        </>
    )
}
